        <div class="col-6 align-center justify-center">
            <div class="paragraph-section">
                <p class=paragraph>Somos uma organização que surgiu com o intuito de aproximar voluntários na causa
                    ambiental e incentivar
                    novos públicos a fazer parte do movimento por meio de uma rede
                    social que promova eventos.
                    O projeto se expandiu e atualmente também prestamos suporte na área de sustentabilidade para
                    empresas e
                    recicladoras, fornecendo caçambas com tecnologias de pesagem,
                    sensores de quantidade e detector de capacidade máxima atingida. Além de fornecer apoio à áreas de
                    logística e separação de residuos.</p>
            </div>
        </div>
    </div>
